import React from 'react'
import './Task.css'
const task = (props) => {
    const inputStyle = {
        ':focus' : { 
          backgroundColor: 'yellow'
  }
      }
    return (
        <div className = 'Task'>
        <div className = 'TaskDeadlineSep'>
            <p className = 'TaskDeadline' >Task: {props.todo}</p>
            <p className = 'TaskDeadline' >Deadline:  {props.deadline}</p>    
            <p className = 'TaskDeadline delete' onClick = {props.click}>Delete Task</p>
        </div>


        <p>{props.children}</p>
        <input className = 'inputStyle' type= 'text' onChange = {props.changed} value={props.todo}/>
        </div>
    )
    }
export default task
